import React from "react";
import { Link } from "react-router-dom";

function Layout() {
  return (
    <div className="layout">
      <header>
        <img
          className="logo"
          alt="brand logo"
          src="/assets/shared/desktop/logo.svg"
        />
        <nav>
          <ul>
            <li>
              <Link to="/">About</Link>
            </li>
          </ul>
        </nav>
      </header>
    </div>
  );
}

export default Layout;
